import Link from 'next/link';
import React from 'react';
import Head from 'next/head';
import './App.css'; // Tell webpack that Button.js uses these styles

function App() {
  return (
      <div className="App">

       <Head>
         <title>My styled page</title>
         <link href="/static/styles.css" rel="stylesheet" />
       </Head>

        <header className="App-header">
          <img src={'https://img.pokemondb.net/artwork/bulbasaur.jpg'} className="App-logo"/>
          <p>
            Welcome to michaeldipaolo.com 
          </p>

          <Link href="/resume" title="Resume">
              <a>Continue to my resume</a>
          </Link>

        </header>

      </div>
  );
}

export default App;
